import React from "react";
import "./_nav.scss";
import "../_generales.scss";
import Cart from "./Cart";

const NavBar = () => {
  return (
    <nav>
      <div className="lista">
        <link to="/">Inicio </link>
        <link to="/Usuarios">Usuarios</link>
        <link to="/ItemListContainer">Lolcito</link>
      </div>
      <Cart />
    </nav>
  );
};

export default NavBar;
